import './UserHome.css'


class Recents extends Component {
constructor(props) {
super(props);
this.state = {
data: null,
};
}
//var body;
componentDidMount() {
fetch('http://localhost:9000/recentCrops')
.then(response => response.json())
.then(data => this.setState({ data }));
}

render(){
return (
<div class = "recentbids">
<Container>
<Row>
{this.state.data}
</Row>
</Container>
</div>
);
}}

export default Recents;
